      state: "مجمد",
    },
    {
      id: 5,
      name: "ورد صناعي",
      state: "نشط",
    },
    {
      id: 6,
      name: "ورد صناعي",
      state: "نشط",
    },
  ];

  return (
    <CustomComp
      title="التصنيفات"
      paragraphe="عدد التصنيفات 37 طلب"
      add="اضافة تصنيف"
      displayTable={<span></span>}
      table={TableCategorie}
      productBox={<span></span>}
      items={itemsCategorie}
      boxx={false}
    />
  );
};

export default Categories;
